__author__ = 'bozeng'


def radixsort(num):
    if not num:
        return []
    if len(num) == 1:
        return num

    radixbucket=[[] for _ in range(10)]
    mask = 10
    tailmask = 1
    flag=True
    while flag:
        flag = False

        for i in range(10):
            radixbucket[i]=[]

        for each in num:

            radixbucket[(each % mask) // tailmask].append(each)
            if (not flag) and each % mask != each:
                flag=True
        j = 0
        for i in range(10):
            for each in radixbucket[i]:
                num[j] = each
                j += 1

        mask = 10 * mask
        tailmask = tailmask * 10

    return num

